import "./App.css";
import { useState } from "react";

function Unit({ unitCode, title }) {
    const [unitName, setUnitName] = useState(title);

    const clickUpper = () => {
        setUnitName(title.toUpperCase());
    };

    const clickLower = () => {
        setUnitName(title.toLowerCase());
    };

    return (
        <div>
            <p>
                {unitCode}: {unitName}
            </p>
            <div onClick={clickUpper}>
                <p>Upper Case</p>
            </div>
            <div onClick={clickLower}>
                <p>Lower Case</p>
            </div>
        </div>
    );
}

function App() {
    return (
        <div className="App">
            <header className="App-header">
                <p>
                    Edit <code>src/App.js</code> and save to reload.
                </p>
                <a
                    className="App-link"
                    href="https://reactjs.org"
                    target="_blank"
                    rel="noopener noreferrer"
                >
                    Learn React
                </a>
                <Unit
                    unitCode={"COMP3120"}
                    title={"Advanced Web Developmen"}
                ></Unit>
            </header>
        </div>
    );
}

export default App;
